    def aperta_7(self, event):
        if event.keysym == "7":
            self.seven()

    def aperta_8(self, event):
        if event.keysym == "8":
            self.eight()

    def aperta_9(self, event):
        if event.keysym == "9":
            self.nine()

    def aperta_0(self, event):
        if event.keysym == "0":
            self.zero()

    def aperta_menos(self, event):
        if event.keysym_num == 45:
            self.subtraction()

    def aperta_mais(self, event):
        if event.keysym_num == 43:
            self.adiction()

    def aperta_x(self, event):
        if event.keysym == "x" or event.keysym_num == 42:
            self.mult()

    def aperta_div(self, event):
        if event.keysym_num == 47:
            self.division()

    def aperta_back(self, event):
        if event.keysym == "BackSpace":
            self.remove()

    def aperta_ponto(self, event):
        if event.keysym_num == 46:
            self.flutuar()

