    def execute(self):
        if self.m == 1:
            self.B = float(self.dado2)
            self.resultado = self.B * self.A
            self.dado1 = str(self.resultado)
            self.dado2 = self.dado1
            self.teste()
            self.tela_exibicao.config(text=str(self.dado1))
            self.m = 0

            try:
                with open("Histórico.txt", "a") as storie:
                    horario = datetime.now()
                    horario = horario.strftime("%d-%m-%Y %H:%M:%S")
                    storie.write(horario)
                    storie.write(" --> ")
                    storie.write(str(self.A))
                    storie.write(' x ')
                    storie.write(str(self.B))
                    storie.write(' = ')
                    storie.write(str(self.resultado))
                    storie.write("\n")

            except:
                with open("Histórico.txt", "a") as storie:
                    storie.write(horario)
                    storie.write(" --> Não foi possível registrar!\n")

        elif self.s == 1:
            self.B = float(self.dado2)
